### 1. Import the necessary function:
Add this import statement at the top:
```kotlin
import androidx.compose.ui.res.painterResource
```

### 2. Reference your drawable resources:
Replace the `Icon` composable with the `Image` composable and use `painterResource` like this:
```kotlin
Image(
 painter = painterResource(id = R.drawable.your_image_name),
 contentDescription = label,
 modifier = Modifier.size(32.dp)
)
```
> Replace `your_image_name` with the actual name of your image in the `res/drawable` folder, e.g. `R.drawable.basketball_icon`.

### 3. Example adjustment for your scrollable icon row:
```kotlin
Row(
 modifier = Modifier
 .horizontalScroll(rememberScrollState())
 .padding(horizontal = 16.dp)
) {
 listOf(
 R.drawable.ic_all to "All",
 R.drawable.ic_basketball to "Basketball",
 R.drawable.ic_bmx to "BMX",
 R.drawable.ic_debate to "Debate",
 R.drawable.ic_critical to "Critical..",
 R.drawable.ic_community to "Community",
 R.drawable.ic_blood to "Blood Dona.."
 ).forEach { (res, label) ->
 Column(
 horizontalAlignment = Alignment.CenterHorizontally,
 modifier = Modifier.padding(horizontal = 10.dp)
 ) {
 Image(
 painter = painterResource(id = res),
 contentDescription = label,
 modifier = Modifier.size(32.dp)
 )
 Text(
 text = label,
 fontSize = 10.sp,
 color = Color(0xFF877BBA),
 fontWeight = if (label == "All") FontWeight.Bold else FontWeight.Normal
 )
 }
 }
}
```
Make sure you add the required images (e.g. `ic_all.xml`, `ic_basketball.xml`, etc.) to your `res/drawable` directory.

