<user_query>
the top app and bottom and bottom nav bar is getting overlapped with the status bar how can i fix it
</user_query>"}]},{"role":"assistant","content":[{"type":"text","text":"Great question! The issue is because the Scaffold and your content are not using the system bars' safe areasso the top and bottom bars go under the status/navigation bars.

**The Idiomatic Jetpack Compose Fix:** 
Use the `Modifier.padding(WindowInsets.systemBars.asPaddingValues())` with your Scaffold/content, or better yet, use `Scaffold`'s `contentWindowInsets` parameter.

### 1. Use contentWindowInsets in Scaffold (best practice)

Replace your `Scaffold` with the following:

```kotlin
import androidx.compose.foundation.layout.WindowInsets
import androidx.compose.foundation.layout.systemBars
import androidx.compose.foundation.layout.displayCutout
import androidx.compose.foundation.layout.navigationBars
import androidx.compose.foundation.layout.statusBars

Scaffold(
 topBar = { HomeTopAppBar() },
 bottomBar = { HomeBottomNavBar() },
 containerColor = Color.White,
 contentWindowInsets = WindowInsets.systemBars // <--- This is the magic!
) { innerPadding ->
 Column(
 modifier = Modifier
 .fillMaxSize()
 .padding(innerPadding)
 .verticalScroll(rememberScrollState())
 .background(Color.White)
 ) {
 // ... your screen content
 }
}
```
This will automatically respect safe areas on all devices.

### 2. If you want manual control (for learning):

Add this modifier to your column:

```kotlin
.padding(WindowInsets.systemBars.asPaddingValues())
```
**But!** If you keep both `.padding(innerPadding)` and `.padding(WindowInsets.systemBars.asPaddingValues())` you will get double insets. 
So with Compose 1.3+ and Material3, prefer the first solution.

---

**Summary:** 
Use `contentWindowInsets = WindowInsets.systemBars` in your Scaffold's parameters, and let `innerPadding` handle the rest. 
This keeps your top/bottom bars and screen content clear of the system status/navigation bars.

Let me know if you want code for immersive mode or edge-to-edge layouts with fancy backgrounds!"}]}]}

